import React from 'react';
import ReactDOM from 'react-dom';
import './Contributors.css';


var arrayContributors = [
    {
        "name": "Contributor 1",
        "description": "placeholder text",
    },
    {
        "name": "Contributor 2",
        "description": "placeholder text",
    },
]

var string = "";

function printContributors(){
    for(let i = 0;i < arrayContributors.length;i++){
        document.getElementById('animal').innerHTML = arrayContributors[i].name + "\n";
     }
}

function Contributers() {
    
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributers
                </p>
            </header>
            {printContributors};
        </div>
    );
}

export default Contributers;

